import axios from "axios";
const App = () => {
  const [orders, getOrders] = useState([]);
  const url = "https://assessment.api.vweb.app/products";
  const getDetails = () => {
    axios
      .get(url)
      .then((response) => {
        getOrders(response.data.orders);
      })
      .catch((error) => console.error(`Error: ${error}`));
  };

  useEffect(() => {
    getDetails();
  }, []);

  return <div>{console.log(orders)}</div>;
};

export default App;
